private void writeLine() throws IOException {
  Iterator<ImageElement> it = elementsToTrack.iterator();

  while(it.hasNext()) {
    ImageElement e = it.next();

    String v = null;
    if(e == ImageElement.NUM_BYTES)
      v = String.valueOf(fileSize);
    else
      v = elements.get(e);

    if(v != null)
      write(v);

    if(it.hasNext())
      write(delimiter);
  }
}
